import React from 'react';
import "../css/About.css";
import img2 from "../images/college_photo_2.jpg";
import img3 from "../images/college_photo_3.jpg";
import img4 from "../images/college_photo_4.jpg";

const About = () => {
    return (
        <>
            <div className="container-fluid custom-section">
                <div className="first-half">
                    <div>
                        <p><span>__</span></p>
                        <h6>About Us</h6>
                    </div>
                    <div>
                    <h4>SOME CONTENT TO DISPLAY</h4>

                    </div>
                </div>
                <div className="second-half"></div>
            </div>
        </>
    );
}

export default About;
